import React from "react";
import { Outlet } from "react-router-dom";
import Navbar from "./Navbar";

const Home = ({ logged, setLogged }) => {
  return (
    <div>
      <div>
        <Navbar logged={logged} setLogged={setLogged} />
      </div>
      <Outlet />
    </div>
  );
};

export default Home;
